using yourInvoice.Common.Business.CatalogModule;
using yourInvoice.Common.Integration.Storage;
using yourInvoice.Offer.Application.Beneficiary.Create;
using yourInvoice.Offer.Domain.Documents;
using yourInvoice.Offer.Domain.MoneyTransfers;
using yourInvoice.Offer.Domain.Offers;
using yourInvoice.Offer.Domain.Primitives;
using static yourInvoice.Common.ErrorHandling.MessageHandler;

namespace Application.Customer.UnitTest.Beneficiary
{
    public class CreateBeneficiaryCommandHandlerTest
    {
        private readonly Mock<IMoneyTransferRepository> _mockRepository;
        private readonly Mock<IUnitOfWork> _mockUnitOfWork;
        private readonly Mock<IStorage> _mockIStorage;
        private readonly Mock<IOfferRepository> _mockIOfferRepository;
        private readonly Mock<IDocumentRepository> _mockIDocumentRepository;
        private readonly Mock<ICatalogBusiness> _mockCatalogBusiness;
        private readonly CreateBeneficiaryCommandHandler _handler;

        public CreateBeneficiaryCommandHandlerTest()
        {
            _mockRepository = new Mock<IMoneyTransferRepository>();
            _mockUnitOfWork = new Mock<IUnitOfWork>();
            _mockIStorage = new Mock<IStorage>();
            _mockIOfferRepository = new Mock<IOfferRepository>();
            _mockIDocumentRepository = new Mock<IDocumentRepository>();
            _mockCatalogBusiness = new Mock<ICatalogBusiness>();

            _handler = new CreateBeneficiaryCommandHandler(_mockRepository.Object, _mockUnitOfWork.Object, _mockIStorage.Object, _mockIOfferRepository.Object,
                _mockIDocumentRepository.Object, _mockCatalogBusiness.Object);
        }

        [Fact]
        public async Task HandleCreateBeneficiary_Sucess()
        {
            //Arrange
            // Se configura los parametros de entrada de nuestra prueba unitaria.

            CreateBeneficiaryCommand command = new(new Guid(), It.IsAny<string>(), It.IsAny<Guid>(), It.IsAny<string>(), It.IsAny<Guid>(), It.IsAny<Guid>(), It.IsAny<string>(), It.IsAny<decimal>()
                , "",
                ""
                , It.IsAny<Guid>());
            _mockRepository.Setup(x => x.ExistsByDocumentAsync(It.IsAny<string>(), It.IsAny<Guid>(), It.IsAny<Guid>())).ReturnsAsync(false);
            _mockRepository.Setup(c => c.CountBeneficiaryAsync(It.IsAny<string>(), It.IsAny<Guid>())).ReturnsAsync(0);
            _mockIOfferRepository.Setup(y => y.GetByIdAsync(It.IsAny<Guid>())).ReturnsAsync(new yourInvoice.Offer.Domain.Offer(It.IsAny<Guid>(), It.IsAny<Guid>(), It.IsAny<Guid>(), DateTime.UtcNow, DateTime.UtcNow, "", CatalogCode_OfferStatus.InProgress));
            _mockIStorage.Setup(x => x.UploadAsync(It.IsAny<byte[]>(), It.IsAny<string>())).ReturnsAsync("ruta");
            _mockIOfferRepository.Setup(z => z.OfferIsInProgressAsync(It.IsAny<Guid>())).ReturnsAsync(true);
            _mockCatalogBusiness.Setup(x => x.GetByIdAsync(It.IsAny<Guid>())).ReturnsAsync(new yourInvoice.Common.Entities.CatalogItemInfo() { Descripton = "10" });
            //Act
            // Se ejecuta el metodo a probar de nuestra prueba unitaria
            var result = await _handler.Handle(command, default);
            //Assert
            // Se verifica los datos de retorno de nuestro metodo probado en la prueba unitaria
            result.IsError.Should().BeFalse();
            Assert.NotNull(result.Value);
        }

        [Fact]
        public async Task HandleCreateBeneficiary_WhenBeneficiaryExist_ShouldReturnValidationError()
        {
            //Arrange
            // Se configura los parametros de entrada de nuestra prueba unitaria.
            CreateBeneficiaryCommand command = new(new Guid(), It.IsAny<string>(), It.IsAny<Guid>(), It.IsAny<string>(), It.IsAny<Guid>(), It.IsAny<Guid>(), It.IsAny<string>(), It.IsAny<decimal>()
                , It.IsAny<string>(), It.IsAny<string>(), It.IsAny<Guid>());
            _mockRepository.Setup(x => x.ExistsByDocumentAsync(It.IsAny<string>(), It.IsAny<Guid>(), It.IsAny<Guid>())).ReturnsAsync(true);

            //Act
            // Se ejecuta el metodo a probar de nuestra prueba unitaria
            var result = await _handler.Handle(command, default);
            //Assert
            // Se verifica los datos de retorno de nuestro metodo probado en la prueba unitaria
            result.IsError.Should().BeTrue();
            result.FirstError.Type.Should().Be(ErrorType.Validation);
            Assert.Equal(GetErrorDescription(MessageCodes.BeneficiaryExist), result.FirstError.Description);
        }
    }
}